API_KEY = ""
SECRET_KEY = ""


def save_base64_2_pic(base64_str):
    # 去掉base64字符串的头部信息（如果有的话），例如：'data:image/jpeg;base64,'
    # 注意：这取决于你的base64字符串的来源，有些可能不需要这一步
    if ',' in base64_str:
        base64_str = base64_str.split(',')[1]
    base64_bytes = base64.b64decode(base64_str)

    # 使用BytesIO将字节数据转换为文件对象
    image_file = BytesIO(base64_bytes)

    # Using PIL to open the image and convert it to RGB if it's in RGBA mode
    image = Image.open(image_file)
    if image.mode == 'RGBA':
        image = image.convert('RGB')  # This will discard the alpha channel

    # ... (rest of the code remains the same) ...
    file_path = f'{int(time.time())}.jpg'
    image.save(file_path)  # Now it should save without issues since the image is in RGB mode

    return file_path


def del_temp_pic(pic_path):
    os.remove(pic_path)


def parse_input_path(func):
    # 装饰器
    def wrapper(image_path):
        if os.path.isfile(image_path):
            image_path = image_path
        else:
            image_path = save_base64_2_pic(image_path)
        result = func(image_path)  # 调用原始函数
        del_temp_pic(image_path)
        return result

    return wrapper


@parse_input_path
def pytesseract_ocr(img_path):
    img = Image.open(img_path)
    # img = ImageEnhance.Contrast(img).enhance(2)  # 增强对比度
    # img = img.filter(ImageFilter.MedianFilter())  # 中值滤波去噪
    # img = ImageOps.invert(img.convert('L'))  # 转换为灰度并反转颜色（二值化的一种方式）
    text: str = pytesseract.image_to_string(img, lang='chi_sim+eng')

    # strip white space characters
    ocr_word = text.replace(" ", "").replace('\n', '')
    # Print the extracted text
    # print(ocr_word)
    return ocr_word


def baidu_high_precision_ocr(pic_base_64):
    def get_access_token():
        """
        使用 AK，SK 生成鉴权签名（Access Token）
        :return: access_token，或是None(如果错误)
        """
        url = "https://aip.baidubce.com/oauth/2.0/token"
        params = {"grant_type": "client_credentials", "client_id": API_KEY, "client_secret": SECRET_KEY}
        return str(requests.post(url, params=params).json().get("access_token"))

    url = "https://aip.baidubce.com/rest/2.0/ocr/v1/accurate_basic?access_token=" + get_access_token()

    # payload = f'image={pic_base_64}&detect_direction=false&paragraph=false&probability=false'
    data = {'image': pic_base_64,
            'detect_direction': 'false',
            'paragraph': 'false',
            'probability': 'false'}
    headers = {
        'Content-Type': 'application/x-www-form-urlencoded',
        'Accept': 'application/json'
    }

    response = requests.request("POST", url, headers=headers, data=data).json()
    ocr_word = ''
    try:
        if response['words_result']:
            for word_item in response['words_result']:
                ocr_word += word_item['words']
        else:
            print('未识别到任何数据!')
            save_base64_2_pic(pic_base_64)
        # print(ocr_word)
        return ocr_word
    except KeyError as e:
        print(response)
        raise e


def easy_ocr(image_path):
    # 初始化Reader对象，指定识别语言
    reader = easyocr.Reader(['en', 'ch_sim'], gpu=True)
    # 读取图片并识别文本
    image_path = parse_input_path(image_path)  # 图片路径，请替换为你自己的图片路径
    results = reader.readtext(image_path)
    # 打印识别结果
    for res in results:
        print(f'{res[1]}')


